import React from "react";
import { Link } from "react-router-dom";
import { ListGroup, ListGroupItem } from "reactstrap";

function MenuBar() {
    return (
        <div>
            <ListGroup>
                <Link tag="a" to="/" action>Home</Link>
                <br/>
                <Link tag="a" to="/addcustomer" action>Add Customer</Link>
                <Link tag="a" to="/viewcustomers" action>View Customers</Link>
                <br/>
                <Link tag="a" to="/addproperty" action>Add Property</Link>
                <Link tag="a" to="/viewproperties" action>View Properties</Link>
                <br/>
                <Link tag="a" to="/addbooking" action>Book Property</Link>
                <Link tag="a" to="/viewbookings" action>View Bookings</Link>
                <br/>
                <Link tag="a" to="/addpayment" action>Payment</Link>
                <Link tag="a" to="/viewpayments" action>View Payments</Link>
            </ListGroup>
        </div>
    )
}

export default MenuBar;
